import { LoginBox, MainMenuBox, MenuButton } from "../styles/Menu";
import { MenuButtonY } from "./buttons/MenuButtonsY";

export const MenuHidden = ({ isOpen }: any) => {
  return (
    <MainMenuBox theme={isOpen}>
      <MenuButtonY img={"orderHistory"} label={"My orders"} />
      <MenuButtonY img={"myLists"} label={"My lists"} />
      <MenuButtonY img={"orderHistory"} label={"Dark mode"} />

      <LoginBox>
        <input>xD</input>
        <input>xD</input>
      </LoginBox>
      {/* <MenuButtonY img={"logout"} label={"logout"} /> */}
    </MainMenuBox>
  );
};
